import React, { Component } from 'react';

class NotFound extends Component {
	render() {
		return (
			<Container>
				<Row className="justify-content-md-center">
					<h1><b>Page not found.</b></h1>
				</Row>
			</Container>
		);
	}
}


export default NotFound;
